export const Notification = ({ close }) => {
  const [toggleActiveDelete, setToggleActiveDelete] = useState(false);

  return (
    <Wrapper>
      <Header>
        <Button
          startIcon={LeftArrowIcon}
          onClick={() => close()}
          size="xlarge"
          padding="0"
          variant="transparent"
        />
        <Heading>알림</Heading>
        <Button
          onClick={() => setToggleActiveDelete((prev) => !prev)}
          size="large"
          fontWeight="400"
          padding="0"
          variant="transparent"
        >
          {toggleActiveDelete ? '닫기' : '편집'}
        </Button>
      </Header>
      <CategorySwiper
        type="notification"
        items={notifications}
        isContentScrollY={true}
        toggleActiveDelete={toggleActiveDelete}
      ></CategorySwiper>
    </Wrapper>
  );
};

